  computed: {
    uncovered () {
      const uncover = this.pieces
        ? Array(this.pieces)
          .fill()
          .map((_, i) => i)
        : []

      return new Set(this.uncover || uncover)
    }
  },

  watch: {
    studentId () {
      this.getPieces()
    }
  },

  created () {
    this.getPieces()
  },

  methods: {
    ...mapActions('children/puzzle', ['getPuzzleByChildId']),

    async getPieces () {
      if (this.studentId) {
        try {
          const { pieces } = await this.getPuzzleByChildId({
            id: this.studentId
          })

          this.pieces = pieces
        } catch (e) {}
      }
    }
